import './Search.css';
//import React, { useState } from "react";
import React, { useState, useEffect } from "react";


function Search({ setResults }) {
  const [bloodType, setBloodType] = useState("");
  const [location, setLocation] = useState("");
  const [radius, setRadius] = useState("25");
  const [users, setUsers] = useState([]);

  useEffect(() => {
    fetch('/data/users.json')
      .then(res => res.json())
      .then(data => setUsers(data))
      .catch(err => console.error(err));
  }, []);


  const searchDonors = () => {
    if (!bloodType || !location) {
      alert("Please select a blood type and enter a location!");
      return;
    }
    // For now, just log ‚Äî later we‚Äôll fetch from backend

    const filtered = users.filter(
      user => 
        user.bloodGroup.toLowerCase() === bloodType.toLowerCase() && user.city.toLowerCase().includes(location.toLowerCase())
    );
    setResults(filtered);
    
  };

  return (
    <section id="search" className="search-section">
      <div className="container">
        <h2 className="title">Find Blood Donors</h2>
        <form className="search-form">
          {/* <div className="results">
            {results.length > 0 ? (
              results.map(user => (
                <div key={user.id} className="donor-card">
                  <p><strong>{user.name}</strong></p>
                  <p>Blood Group: {user.bloodGroup}</p>
                  <p>City: {user.city}</p>
                  <p>Contact: {user.contact}</p>
                </div>
              ))
            ) : (
              <p>No donors found</p>
            )}
          </div> */}

          <div className="form-group">
            <label htmlFor="bloodtype" className="form-label">Blood Type Needed</label>
            <select
              id="bloodtype"
              className="form-control"
              value={bloodType}
              onChange={(e) => setBloodType(e.target.value)}
            >
              <option value="">Select Blood Group</option>
              <option value="A+">A+</option>
              <option value="A-">A-</option>
              <option value="B+">B+</option>
              <option value="B-">B-</option>
              <option value="AB+">AB+</option>
              <option value="AB-">AB-</option>
              <option value="O+">O+</option>
              <option value="O-">O-</option>
            </select>
          </div>

          <div className="form-group">
            <label htmlFor="location" className="form-label">Location</label>
            <input
              type="text"
              id="location"
              className="form-control"
              placeholder="Enter city, state"
              value={location}
              onChange={(e) => setLocation(e.target.value)}
            />
          </div>

          <div className="form-group">
            <label htmlFor="radius" className="form-label">Search Radius</label>
            <select
              id="radius"
              className="form-control"
              value={radius}
              onChange={(e) => setRadius(e.target.value)}
            >
              <option value="10">10 miles</option>
              <option value="25">25 miles</option>
              <option value="50">50 miles</option>
              <option value="100">100 miles</option>
            </select>
          </div>

          {/* The button spans all columns below */}
          <div className="form-group form-group-full">
            <button type="button" className="search-section-button" onClick={searchDonors}>
              <span role="img" aria-label="search">üîç</span> Search Donors
            </button>
          </div>
        </form>
      </div>
    </section>
  );
}

export default Search;
